CLASS = "Třída";
CLASS_DRUID = "        Druidi žijí v bezpříkladném stavu svázané s přírodou. Pevně vázány s královstvím rostlinné a živočišné říše a tvoří přírodní tvary, takže hned vědí z první ruky zneužívání jejich divokých bratrů. V důsledku, přes jejich počty, se druidi stavají více ostražití, samotářský a nároční na místo. Jen málo cizinců ví o jejich hlubokém tajemství.";
CLASS_HUNTER = "        Lovci znají nezmapovaná místa světa. Nadaný s hlubokou empatii pro veškerý život, mají podivný talent pro zpřátelení volně žijících zvířat a jejich zkrocení jako domácí zvířata. Kromě toho, lovci mohou používat své jemně vytříbené smysly, aby se stali mistry Stopování. Všude tam, kde lovci bojují dokážou pustošít a rozsévat nemoci, vykořisťovat a industrializovat.";
CLASS_MAGE = "        Kouzelníci jsou čarodějové nesmírných znalostí a dovedností. Jejich zjevná fyzická slabost je ošidná, protože mohou vyvolat kosmickou energii z Twisting Nether. Málokdy se kouzelníci tlačí do prvních řad při boji. Místo toho raději útočí z větší vzdálenosti a kouzlí silné ledové a ohnivé blesky na jejich nepřátele.";
CLASS_PALADIN = "Paladinové bojují aby chránili svět před silami stínu. Mocní bojovníci v jménu jejich práva, také můžou zavolat na pomoc světlo pro vyléčení ran, vytvoření štítu a zatracení zlých mocí. Přestože Paladinové byli kdysi výlučně lidé, počty dobrosrdečných trpaslíků byly nedávno přivítáni do Řádu Stříbrné Ruky.";
CLASS_PRIEST = "Kněží vedoucí duchovní osud svých lidí. Ačkoli mají unikátní pohled do mysli, jsou schopni tvořit inviduální víru, která inspiruje i děsí, uklidňuje i ovládá, léčí i ubližuje. Právě tak můžou v nitru udržovat obojí - temnotu a světlo, kněžské vládnutí tvoření síly a ničení rýsující se mocné síly základní víry.";
CLASS_ROGUE = "        Tuláci jsou nejúspěšnější, když se svými činy nikdy nepříjdou na světlo. Využívají nalezené jedy a tiché vrhací zbraně. Spoléhají na tajné směsy a menší mysticismus. Obvykle využívají  bohaté šlechtice nebo místní vlády a přerozdělují bohatství nebo odstraňují určené cíle. Tulácká oddanost trvá vždy jen tak dlouho, jako poslední kontrakt.";
CLASS_SHAMAN = "        Shaman commune directly with the elements. Their combination of wisdom and resilience makes them ideal as tribal advisors and leaders. In battle the shaman use totems and spells to manipulate the elements and provoke other fighters to untold heights of rage and might. Shaman exemplify the primal bond between the savage races and their environment.";
CLASS_WARLOCK = "        Čarodějové jsou prokletí po celý život. Zmocněni démonické krve, mohou způsobit velké trápení nad svými nepřáteli. K doplnění jejich energie, kterou potřebují pro kouzlení, čarodějové vysávají život svým obětem a tím si ji doplňují. Čarodějové také mohou přivolávat a kontrolovat děsivé ďábelské subjekty. Stále se čarodějů  obávají všichni ostatní pro jejich zvláštní zlost a krutost.";
CLASS_WARRIOR = "        Válečníci se učí a neustále usilují o dokonalost v ozbrojeném boji. Přestože pocházejí ze všech profesí, které spojuje jejich samostatné odhodlání, aby se zapojili do slavné bitvy. Mnoho válečníků slouží jako žoldáci, zatímco jiní jsou dobrodružní, nebezpeční a stateční lovci. Typický válečník je silný, tvrdý a mimořádně násilný.";
