RACE = "Rasa";
RACE_INFO_DWARF = "        V minulosti záleželo trpaslíkům jen na bohatství, které získávali z hlubin země. Pak se vynořili na povrch záznamy, že o boha-podobné rase lze říci, že vzhledem k trpasličímu životu... mají právo okouzleného prvorozenství. Chtěli se dozvědět mnohem více a tak trpaslíci se věnovali geologii, aby objevili ztracené artefakty a starobylé vědomosti. Dnes jsou trpasličí archeologové roztroušni po celém světě.";
RACE_INFO_GNOME = "        I když jsou to malé postavy, tak si gnomové z Khaz Modanu využili svoji skvělou inteligenci, aby si zabezpečili svoje místo v historii. A skutečně jejich podzemní království Gnomeregan bylo zázračně poháněno parní technologií. A díky masivní invazi troggů bylo město ztraceno. Nyní z jejich stavitelů se stali tuláci na trpasličím území a pomáhají svým spojencům jak jen nejlépe umí.";
RACE_INFO_HUMAN = "        Lidé jsou mladá rasa a tedy velmi všestranná, zvládá bojová umění, řemesla a magii s ohromující účinností. Lidská odvaha a optimismus je vedla k postavení některých největších světových království. V tomto neklidném období, po generací konfliktů se snaží lidstvo znovu získat svoji slávu a obnovit zářivou novou budoucnost.";
RACE_INFO_NIGHTELF = "Před desetitisíci lety, Noční elfi založili obrovskou říši, ale svoje bezohledné užívání základní magie je dovedlo k zničení. V zármutku odešli do lesů a zůstali tam izolovaní až do návratu svých prastarých nepřátel, plamené legie. Bez jiné možnosti se nakonec Noční elfi vynořili ze svých úkrytů do boje za své místo v novém světě.";
RACE_INFO_ORC = "        Rasa orků pocházející z planety Draenor. Pokojní lidé se shamanickými vírami, byli zotročeni Plamenou legií a byli donuceni k válce s lidmi z Azerothu. Ačkoli jim to trvalo mnoho let, orkové nakonec unikli zkaženým démonům a vyhráli si svou svobodu. Tyto časy boje za čest v cizým světě nenáviděli a nadávali jim.";
RACE_INFO_SCOURGE = "Osvobozeni ze spárů Krále Lichů, zatracení usilují o svržení jeho vlády. Pod vedením přízraku Sylvanase, dychtí po odplatě navzdory zhoubě. Lidé se také stali jejich nepřáteli, neúprosní ve svém snažení vyhladit všechny nemrtvé z kraje. Zatracení se příliš nezajímají ani o své spojence. Pro ně je Horda pouze nástrojem, který by mohl posunout jejich temné úmysly vpřed.";
RACE_INFO_TAUREN = "        Taurové se vždy snažili uchovat rovnováhu přírody a věnovali se její bohyni, matce zemi. Nedávno napadení vražednými kentaury, taurové chtěli být schovaní. Dávali šanci setkání s orky, kteří jim pomohli porazit vetřelce. Ctící tento krvavý dluh se taurové spojili s hordou, a tak sjednotili dvě přátelské rasy.";
RACE_INFO_TROLL = "        Kdysi v domovské džungli Stranglethornského údolí, divocí trollové z  kmenu Darkspear byli tlačeni pryč soupeřícími frakcemi. Nakonec se trollové spřátelili s hordou, a Thrall, mladý vůdce orků, přesvědčil trolly aby s ním cestovali do Kalimdoru. Ačkoli lpěli na svých tradicích, Darkspearští trollové si drželi ctěné místo v hordě.";
